import { MenuLinkStyles } from './MenuLinkStyles';

export default function MenuLink({ product, ref }) {
  console.log(product);
  return (
    <MenuLinkStyles>
      <a href={product.title} ref={ref}>
        {product.title}
      </a>
    </MenuLinkStyles>
  );
}
